class Ninjas extends Component{
    render(){
        const { ninjas } = this.props;
        const ninjaList = ninjas.map( ninja => {
            return(
                <div className = "ninja" key = {ninja.id}>
                <div> Name: { name }></div>
                <div> age: { age }></div>
                <div> race: { race }></div>
                </div>
            )
        })

        return(

            <div className="ninja-list">
                {ninjaList}
            </div>

        )
    }

}
export default Ninjas;
